<script>
import {exampaperRecordById} from "@/api";


export default {
  name: 'courseList',
  data() {
    return {
      headNav: "/exam/examIndex",
      exSuspendShow: true,
      examInfo:{
        paperName:' ',
        testTime:0,
        correctNum:0,
        qstCount:1
      }
    }
  }, components: {
  },
  methods: {
    openAnalysis(){
      this.$emit('openStep')
    },
    init(examRecord){
      console.log(examRecord)
      exampaperRecordById(examRecord.id).then(res=>{
        this.examInfo = res.data.data
      })
    },
    getTime(s){
      //计算分钟
      //算法：将秒数除以60，然后下舍入，既得到分钟数
      var h;
      h  =   Math.floor(s/60);
      //计算秒
      //算法：取得秒%60的余数，既得到秒数
      s  =   s%60;
      //将变量转换为字符串
      h    +=    '';
      s    +=    '';
      //如果只有一位数，前面增加一个0
      h  =   (h.length==1)?'0'+h:h;
      s  =   (s.length==1)?'0'+s:s;
      return h+'分'+s+"秒";
    },
    toErrorList(){
      this.$router.push({ path: "/uc/examRecord", query:{active:2}});
    },
    toIndex(){
      this.$router.push({ path: "/exam/examIndex" });
    },
    toAnswer(){
      this.$router.push({ path: "/exam/examAnswer",query:{id:this.examInfo.epId} });
    }
  },
  mounted: function () {
  },
  props:{
    examRecord: Object,
  },
  watch: {
    examRecord: {
      deep: true,
      immediate: true,
      handler(newVal){
        console.log(111)
        this.init(newVal)
      }
    },

  },
}
</script>

